import React from 'react';
import {
  Button,
  Collapse,
  Navbar,
  NavbarToggler,
  Form,
  FormGroup,
  Input,
  Image,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
  Container } from 'reactstrap';
import logoGarage from './logoGarage.jpeg';


export default class AppNav extends React.Component {
  constructor(props) {
    super(props);

    this.toggle = this.toggle.bind(this);
    this.state = {
      isOpen: false
    };
  }
  toggle() {
    this.setState({
      isOpen: !this.state.isOpen
    });
  }
  render() {
    return (
      <div>

        <Navbar light expand="md"  style={{backgroundColor: '#1d1d1d'}}>
          {/* <NavbarBrand style={{color: '#a28858'}} href="/">reactstrap</NavbarBrand> */}
          <img src={logoGarage} style={{
            width: '159px', 
            height: '40px', 
            margin: '70px', 
            marginTop: '21px' }} />
          <NavbarToggler onClick={this.toggle} />
          <Collapse isOpen={this.state.isOpen} navbar>
            <Nav className="ml-auto" navbar>
              <Form >
                <FormGroup >
                <Input  type="email" name="email" id="exampleEmail" placeholder="Search"  maxLength="70" style={{
                  backgroundColor: '#414141', 
                  color: 'white',
                  margin: '70px',
                  marginTop: '21px',
                  marginRight: '1px'}} />
                </FormGroup>
              </Form>
              {/* <Button></Button> */}
              <NavItem>
                <NavLink style={{color: '#a28858'}} href="/components/">Register</NavLink>
              </NavItem>
              <NavItem>
                <NavLink style={{color: '#a28858'}} href="#">Sign In</NavLink>
              </NavItem>
              <UncontrolledDropdown nav inNavbar>
                <DropdownToggle nav caret>
                  Options
                </DropdownToggle>
                <DropdownMenu right>
                  <DropdownItem>
                    Option 1
                  </DropdownItem>
                  <DropdownItem>
                    Option 2
                  </DropdownItem>
                  <DropdownItem divider />
                  <DropdownItem>
                    Reset
                  </DropdownItem>
                </DropdownMenu>
              </UncontrolledDropdown>
            </Nav>
          </Collapse>
        </Navbar>

      </div>
    );
  }
}
